INSERT INTO `formation` (`id_formation`, `titre`, `description`, `categorie`, `mass_horaire`, `id_formateur`) VALUES
(1, 'Unreal Engine ', 'An Unreal Engine course can prepare you for a career in an exciting field that lets you apply your creative potential to its fullest. Knowledgeable instructors can guide you through learning this powerful, top rated game design platform. ', 'Game Design', 20, 1),
(2, 'Blender', 'Take a step into the exciting world of 3D graphic design with Blender training on learnIt. Learn to use this powerful tool through online Blender classes taught by instructors with real world experience and expertise.\r\n', 'Game Design', 30, 1),
(3, 'Unity', 'Take a Unity course if you are looking for an exciting way to dive into the wonderful world of game design. Taught by real world experts, Unity training can teach you how to build fascinating virtual worlds, control game audio, among other skill', 'Game Design', 20, 1),
(4, 'React JS', 'Whether you are just beginning or looking to develop web apps that utilize the React library, learnIt has a comprehensive selection of React courses. Take one of the many React training courses on Udemy from real world instructors, and develop your skills in this exciting field.', 'Web Development', 33, 4),
(5, 'HTML5', 'As the foundational language of the entire World Wide Web, a working knowledge of HTML is essential for any profession that involves any sort of web developing. Whether you develop websites or apps that use PHP, Java, or JavaScript, it is necessary to first understand HTML. ', 'Web Development', 40, 4),
(6, 'JavaScript', 'Join more than 12 million learners and train up on JavaScript on learnIt. Choose from a wide range of top-rated JavaScript courses. From back-end development to app or website building. Our real-world experts can lead you through hands-on projects to apply your skills.', 'Web Development', 30, 4),
(7, 'Adobe Illustrator', 'Learn Adobe Illustrator from the real-world experts on learnIt. We’ve made learning easier with hands-on exercises, quizzes etc. These courses are frequently updated, so you’ll be working with the latest version of Illustrator and learn about any new features.', 'Graphic Design', 20, 3),
(8, 'Digital Painting', 'Join thousands of learners and take a Digital Painting course on learnIt. Taught by real-world experts, you’ll learn everything from the fundamentals for beginners to advanced tips and tricks for professional artists. Includes hands-on exercises and Q&A’s.', 'Graphic Design', 22, 3),
(9, 'InDesign', 'Working knowledge of InDesign is a highly sought after skill. Whether looking to publish a simple newsletter or design whole magazine outlines, InDesign classes can teach you what you need to know. Join hundreds of thousands of learners, and begin an InDesign course on learnIt.', 'Graphic Design', 20, 3),
(10, 'Email Marketing', 'Email Marketing - Copywriting and Growing Your E-mail Lists Write Effective Sales, To create virtual Mail Transfer Agent (MTA), Copy and use my proven TEMPLATES to grow your business Instantly, To create and configure standard email protocol like DKIM, SPF, DMARC, rDNS on learn It.', 'Digital Marketing', 30, 2),
(11, 'Google Analytics', 'Gain a better understanding of web monitoring with a Google Analytics course from learnIt. Real world experts teach you how to use this popular analysis tool to understand website data.increase visitor traffic to your website, and boost conversions.', 'Digital Marketing', 42, 2),
(12, 'Social Media Marketing', 'Social media marketing classes can give you the tools and strategies to reach your marketing goals if you are looking to boost your online presence and drive traffic to your site or user profile. Do what users of learners have done and join a social media marketing training course.', 'Digital Marketing', 40, 2),
(13, 'Pixel Art', 'If you are an artist looking for new ways to practice your craft, or a game designer wanting to learn tileset building for a video game, a pixel art course can teach you skills to achieve your goals. Start your pixel art class on LearnIt', 'Game Design', 25, 1),
(14, 'CSS', 'Learning how to code HTML without also learning CSS is like learning how to read but not write. All of your hard web development work is lost if you don’t optimize it for different screen sizes. learnIt has top-rated courses to show you how CSS helps you do just that.', 'Web Development', 30, 4),
(15, 'Photoshop', 'Whether you are a professional photographer or you want to improve your snapshots, compelling image, Learn Photoshop from real world professionals on learnIt, join others improving their photographs with this exciting suite of image editing software.', 'Graphic Design', 35, 3),
(16, 'Copywriting', 'Get copywriting training from a real-world expert on learnIt. Whether you’re just starting out or looking to expand your skills, we’ve got you covered. Explore courses on creative copywriting, blogging, SEO copywriting, becoming a freelancer, creating a writing portfolio, and more.', 'Digital Marketing', 40, 2);

